import java.util.*;

public class Number_Needed {
    private static int numberNeeded(String first, String second) {
        int count = 0;
        for (int i = 0; i < first.length(); i++) {
            int index = second.indexOf(String.valueOf(first.toCharArray()[i]));
            if (index > -1) {
                count++;
                StringBuilder stringBuilder = new StringBuilder(second);
                second = stringBuilder.deleteCharAt(index).toString();
            }
        }
        return first.length() + second.length() - (count);
    }

    public static void main(String[] args) {
//        Scanner in = new Scanner(System.in);
        String a = "";
        String b = "";
        System.out.println(numberNeeded(a, b));
    }
}
